import React from 'react'
import styled from 'styled-components'

const Section = styled.section`
// min-height: 80vh;
width: 100%;
background-color: ${props => props.theme.body};
// display: flex;
justify-content: center;
align-items: center;
position: relative;
`

const Lenticular = () => {
  return (
    <Section>Lenticular</Section>
  )
}

export default Lenticular
